// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "hardhat/console.sol";

contract VaultNet {
    // Branding
    string public name = "Vault Net";
    string public symbol = "VNT";

    // Model count
    uint public modelCount = 0;

    // Store all IDs for easy listing/debugging
    uint[] private modelIds;

    // Structure for each AI model
    struct Model {
        uint id;
        string modelName;
        string description;
        string ipfsHash;
        address owner;
        uint timestamp;
    }

    // Mapping of ID to Model
    mapping(uint => Model) public models;

    // Events
    event ModelRegistered(
        uint indexed id,
        address indexed owner,
        string modelName,
        string description,
        string ipfsHash,
        uint timestamp
    );

    event DebugLog(string message, address sender, uint value);

    // Register a new AI model metadata
    function registerModel(
        string memory _modelName,
        string memory _description,
        string memory _ipfsHash
    ) public {
        require(bytes(_modelName).length > 0, "Model name required");
        require(bytes(_ipfsHash).length > 0, "IPFS hash required");

        modelCount++;
        models[modelCount] = Model(
            modelCount,
            _modelName,
            _description,
            _ipfsHash,
            msg.sender,
            block.timestamp
        );
        modelIds.push(modelCount);

        // Log using Hardhat console
        console.log("Model Registered!");
        console.log("ID:", modelCount);
        console.log("Owner:", msg.sender);
        console.log("Name:", _modelName);
        console.log("Description:", _description);
        console.log("IPFS Hash:", _ipfsHash);
        console.log("Timestamp:", block.timestamp);

        emit ModelRegistered(
            modelCount,
            msg.sender,
            _modelName,
            _description,
            _ipfsHash,
            block.timestamp
        );

        emit DebugLog("Model successfully registered", msg.sender, modelCount);
    }

    // Retrieve a model by ID
    function getModel(uint _id) public view returns (
        uint id,
        string memory modelName,
        string memory description,
        string memory ipfsHash,
        address owner,
        uint timestamp
    ) {
        require(_id > 0 && _id <= modelCount, "Invalid model ID");

        Model memory m = models[_id];

        // Log data in view function (works in local test calls)
        console.log("Retrieving Model:");
        console.log("ID:", m.id);
        console.log("Owner:", m.owner);
        console.log("Name:", m.modelName);
        console.log("Description:", m.description);
        console.log("IPFS Hash:", m.ipfsHash);
        console.log("Timestamp:", m.timestamp);

        return (
            m.id,
            m.modelName,
            m.description,
            m.ipfsHash,
            m.owner,
            m.timestamp
        );
    }

    // Retrieve all model IDs
    function getAllModelIds() public view returns (uint[] memory) {
        console.log("Returning all model IDs. Count:", modelIds.length);
        return modelIds;
    }

    // Retrieve all info about the contract
    function getContractInfo() public view returns (
        string memory contractName,
        string memory contractSymbol,
        uint totalModels
    ) {
        console.log("Contract Info requested");
        console.log("Name:", name);
        console.log("Symbol:", symbol);
        console.log("Total Models:", modelCount);
        return (name, symbol, modelCount);
    }
}

